INSERT INTO `live_commentary` VALUES (133666,1,2.1,13,1759675189319,'WICKET','Shoriful Islam to Ibrahim Zadran, B0$ Caught by Nurul Hasan!! Ibrahim Zadran holes out! A skiddy back of a length delivery on off, Ibrahim Zadran tries to pull it off the front foot but is rushed on the stroke. He ends up getting B1$',0,0,'2025-10-05 20:11:28'),(133666,1,0,0,1759675188291,'NONE','Shoriful Islam to Ibrahim Zadran, B0$ Caught!!',0,0,'2025-10-05 20:11:28'),(133666,1,1.6,12,1759675100346,'over-break','Nasum Ahmed to Gurbaz, no run, full delivery on off, Gurbaz leans ahead and eases it to covers',0,0,'2025-10-05 20:11:28'),(133666,1,1.5,11,1759675073953,'FOUR','Nasum Ahmed to Gurbaz, B0$, Gurbaz skips down the track, gets close to the pitch of the ball and hits it over mid-on to get the desired result. Good intent from him and he executed the shot nicely',4,0,'2025-10-05 20:11:28'),(133666,1,1.4,10,1759675049832,'NONE','Nasum Ahmed to Gurbaz, no run, Gurbaz lunges to the floated delivery and blocks it down the pitch',0,0,'2025-10-05 20:11:28'),(133666,1,1.3,9,1759675029222,'FOUR','Nasum Ahmed to Gurbaz, B0$, nicely played! On the shorter side outside off, Gurbaz rocks back and cuts it with the spin through covers to find the fence. Brilliant stroke that',4,0,'2025-10-05 20:11:28'),(133666,1,1.2,8,1759674982838,'NONE','Nasum Ahmed to Ibrahim Zadran, 1 run, coming in with the arm and on a back of a length, Ibrahim Zadran makes a bit of room and cuts it off his stumps through wide mid-off',1,0,'2025-10-05 20:11:28'),(133666,1,1.1,7,1759674967583,'NONE','Nasum Ahmed to Ibrahim Zadran, no run, tossed up delivery, driven on the up to covers',0,0,'2025-10-05 20:11:28'),(133666,1,0,0,1759674959736,'NONE','B0$',0,0,'2025-10-05 20:11:28'),(133666,1,0.6,6,1759674878287,'over-break','Shoriful Islam to Ibrahim Zadran, 1 run, length ball swinging in on middle and off, Ibrahim Zadran punches it on the up. The fielder at mid-on dives to his left to it but lands awkwardly. He seems to be in some pain',1,0,'2025-10-05 20:11:28'),(133666,1,0.5,5,1759674838306,'FOUR','Shoriful Islam to Ibrahim Zadran, B0$, gorgeous shot! Back of a length and some width on offer, Ibrahim Zadran stands tall and punches it crisply on the up in the gap between cover-point and backward point to find the fence',4,0,'2025-10-05 20:11:28'),(133666,1,0.4,4,1759674804319,'NONE','Shoriful Islam to Gurbaz, 1 run, Gurbaz walks down the track and taps this one towards point. Good calling between the two allows them to sneak in a single',1,0,'2025-10-05 20:11:28'),(133666,1,0.3,3,1759674783156,'NONE','Shoriful Islam to Gurbaz, 2 runs, length ball shaping away, Gurbaz walks down the track and hacks at it but gets it off the inner half through mid-wicket. A couple results',2,0,'2025-10-05 20:11:28'),(133666,1,0.2,2,1759674742589,'NONE','Shoriful Islam to Ibrahim Zadran, 1 run, pitched up ball swinging in on middle and leg, Ibrahim Zadran flicks it to wide mid-on to get going',1,0,'2025-10-05 20:11:28'),(133666,1,0.1,1,1759674696397,'NONE','Shoriful Islam to Gurbaz, 1 run, good length ball outside off, shaping away, Gurbaz pushes it off the outer half to third man to get off the mark',1,0,'2025-10-05 20:11:28'),(133666,1,0.1,1,1759674670706,'NONE','Shoriful Islam to Gurbaz, B0$, Gurbaz walks down the track and Shoriful Islam sprays this one down leg, wided',0,0,'2025-10-05 20:11:28'),(133666,1,0,0,1759674667020,'NONE','B0$',0,0,'2025-10-05 20:11:28'),(133666,0,0,0,1759674533343,'NONE','The players and the umpires make their way out to the middle. Shoriful Islam to start off with the new ball.',0,0,'2025-10-05 20:11:28'),(133666,0,0,0,1759673252026,'NONE','B0$ It doesn\'t have that kind of sheen which we associate with Sharjah, the curators have mentioned that the spinners will get help once again. It\'s not a typical Sharjah pitch, it\'s not that hard, pacers will get a bit of help probably with the new ball. The 4-5m length will be tough for the batters to handle against the spinners so they need to employ more of the sweep shot. 140-150 has been chased down earlier, I feel 165 will be a good total on this surface, B1$',0,0,'2025-10-05 20:11:28'),(133666,0,0,0,1759673184601,'NONE','B0$',0,0,'2025-10-05 20:11:28'),(133198,2,0,0,1759650002519,'NONE','B0$ Queensland 248/1 (68), trail by 131 runs',131,0,'2025-10-05 20:11:29'),(133198,2,67.6,408,1759649768507,'over-break','Kieran Elliott to Renshaw, no run',0,0,'2025-10-05 20:11:29'),(133198,2,67.5,407,1759649765856,'NONE','Kieran Elliott to Renshaw, no run',0,0,'2025-10-05 20:11:29'),(133198,2,67.4,406,1759649763270,'NONE','Kieran Elliott to Renshaw, no run',0,0,'2025-10-05 20:11:29'),(133198,2,67.3,405,1759649760814,'NONE','Kieran Elliott to Renshaw, no run',0,0,'2025-10-05 20:11:29'),(133198,2,67.2,404,1759649758239,'NONE','Kieran Elliott to Renshaw, no run',0,0,'2025-10-05 20:11:29'),(133198,2,67.1,403,1759649754855,'NONE','Kieran Elliott to Renshaw, no run',0,0,'2025-10-05 20:11:29'),(133198,2,66.6,402,1759649750798,'over-break','Bradley Hope to Labuschagne, no run',0,0,'2025-10-05 20:11:29'),(133198,2,66.6,402,1759649748152,'NONE','Bradley Hope to Labuschagne, B0$',0,0,'2025-10-05 20:11:29'),(133198,2,66.5,401,1759649744241,'NONE','Bradley Hope to Labuschagne, no run',0,0,'2025-10-05 20:11:29'),(133198,2,66.4,400,1759649740340,'NONE','Bradley Hope to Labuschagne, no run',0,0,'2025-10-05 20:11:29'),(133198,2,66.3,399,1759649738142,'NONE','Bradley Hope to Labuschagne, no run',0,0,'2025-10-05 20:11:29'),(133198,2,66.2,398,1759649733735,'FIFTY','Bradley Hope to Labuschagne, B0$, to deep mid-wicket',0,0,'2025-10-05 20:11:29'),(133198,2,66.1,397,1759649729651,'NONE','Bradley Hope to Labuschagne, no run',0,0,'2025-10-05 20:11:29'),(133198,2,65.6,396,1759649715843,'over-break','Kieran Elliott to Renshaw, no run',0,0,'2025-10-05 20:11:29'),(133198,2,65.5,395,1759649711541,'NONE','Kieran Elliott to Renshaw, no run',0,0,'2025-10-05 20:11:29'),(133198,2,65.4,394,1759649706507,'NONE','Kieran Elliott to Renshaw, no