88,'NONE','Renuka Singh to Sadaf Shamas, no run, short of length outside off, Sadaf Shamas goes on the back foot and pushes it to point',0,0,'2025-10-05 20:11:42'),(121488,2,6.2,38,1759674894988,'NONE','Renuka Singh to Sadaf Shamas, B0$, full and down leg, Sadaf Shamas flicks and misses, Richa Ghosh dives to her left and takes',0,0,'2025-10-05 20:11:42'),(121488,2,6.1,37,1759674862005,'NONE','Renuka Singh to Sadaf Shamas, no run, good length and angled in on middle, defended to mid-wicket, off the back foot',0,0,'2025-10-05 20:11:42'),(121488,2,0,0,1759674802829,'NONE','B0$  \\n30.1 A batter shall be considered to be out of her ground unless some part of her person or bat is grounded behind the popping crease at that end.  \\n30.1.2 However, a batter shall not be considered to be out of her ground if, in running or diving towards her ground and beyond, and having grounded some part of her person or bat beyond the popping crease, there is subsequent loss of contact between the ground and any part of her person or bat, or between the bat and person.  \\nNow because B1$, she was considered to be out of her ground and was given out in accordance with the laws.',0,0,'2025-10-05 20:11:42'),(121488,2,5.6,36,1759674802819,'over-break','Kranti Gaud to Sidra Amin, no run, full outside off, holds its line, similar to the outside-edge earlier in the over, Sidra Amin gets forward to defend and the ball is past the outside-edge, so close too',0,0,'2025-10-05 20:11:42'),(121488,2,5.5,35,1759674774849,'NONE','Kranti Gaud to Sidra Amin, no run, big inswinger and it nips back in, hits the leg as Sidra Amin misses the defence, but the impact was marginal and India are not interested, that nipped in a long way',0,0,'2025-10-05 20:11:42'),(121488,2,5.4,34,1759674731995,'FOUR','Kranti Gaud to Sidra Amin, B0$, B1$ She deflects it wide of first slip too. Lovely full delivery outside off, Sidra Amin pushes at it and it\'s a healthy thick outside-edge, Richa dives to her right, gets a fingertip on it, the edge of the glove and she nutmegs Sneh Rana at 1st slip. Was not an easy catch but should have been taken. Richa was slow to move there',4,0,'2025-10-05 20:11:42'),(121488,2,5.3,33,1759674696979,'NONE','Kranti Gaud to Sidra Amin, no run, nice line and length, big inswinger that is, close to off-stump, Sidra Amin shuffles across and covers off to leave',0,0,'2025-10-05 20:11:42'),(121488,2,5.2,32,1759674671373,'NONE','Kranti Gaud to Sidra Amin, no run, full outside off, solid forward defence',0,0,'2025-10-05 20:11:42'),(121488,2,5.1,31,1759674628408,'NONE','Kranti Gaud to Sadaf Shamas, 1 run, full outside off, Sadaf Shamas carves it in the air but well wide of backward point for one',1,0,'2025-10-05 20:11:42'),(121488,2,4.6,30,1759674578054,'over-break,FOUR','Renuka Singh to Sidra Amin, B0$, soft hands. Length delivery outside off, holds its line, Sidra Amin reaches for it to push, the ball runs away to the third man fence, wide of the third man fielder',0,0,'2025-10-05 20:11:42'),(121488,2,4.5,29,1759674534136,'NONE','Renuka Singh to Sidra Amin, no run, big appeal for LBW. Not given. The big inswinger from Renuka Singh, Sidra Amin shuffles across and gets the front pad outside off, misses the flick andd is struck on the pad, the ump had a long look and decides against it, definitely hit outside off',0,0,'2025-10-05 20:11:42'),(135184,2,8.6,54,1759673300335,'over-break,FOUR','Siya Gokhale to Nkomo, B0$',0,0,'2025-10-05 20:11:43'),(135184,2,8.5,53,1759673297727,'NONE','Siya Gokhale to Dhururu, 1 run',1,0,'2025-10-05 20:11:43'),(135184,2,8.4,52,1759673296232,'NONE','Siya Gokhale to Dhururu, no run',0,0,'2025-10-05 20:11:43'),(135184,2,8.3,51,1759673295126,'NONE','Siya Gokhale to Nkomo, 1 run',1,0,'2025-10-05 20:11:43'),(135184,2,8.2,50,1759673292433,'NONE','Siya Gokhale to Nkomo, 2 runs',2,0,'2025-10-05 20:11:43'),(135184,2,8.1,49,1759673291086,'NONE','Siya Gokhale to Dhururu, 1 run',1,0,'2025-10-05 20:11:43'),(135184,2,7.6,48,1759673147284,'over-break',